import React from "react";
import Footer from "../Components/Footer";
import Header from "../Components/Header";
import { Link } from "react-router-dom";
const NaseSluzby = () => {
  const Box = ({ title }) => {
    const linkTo = `/nase-sluzby/${title.replace(/\s+/g, "-").toLowerCase()}`;

    return (
      <Link to={linkTo} className="box">
        <h2>{title}</h2>
      </Link>
    );
  };
  return (
    <>
      <Header
        background={true}
        title={"Specializace naší advokátní kanceláře"}
      />
      <main className="max-width">
        <h2>Služby v komplexní právní agendě</h2>
        <div className="sluzby-box">
          <Box
            title="Rodinné právo"
            linkTo="/nase-sluzby/rodinne-pravo"
            link="rodinne-pravo"
          />
        </div>
      </main>
      <Footer />
    </>
  );
};

export default NaseSluzby;
